import React from 'react'
import './App.css';
import Header from './components/Header';
import Sidebar from './components/Sidebar'
import Home from './components/Home';
import Footer from './components/Footer';

const App = () => {
  return (
    <>
      <Header />
      <Sidebar />
      <Home />
      <Footer />
    </>
  )
}

export default App;
